module.exports = "<!--Modal para el inicio y cierre mensual-->\r\n<ng-template #validar let-modal>\r\n  <div class=\"modal-header\" id=\"demoFont\">\r\n    <h6 class=\"modal-title\"><i class=\"fas fa-calendar-alt\"></i> <strong> Validar accion</strong></h6>\r\n    <button type=\"button\" class=\"close\" aria-label=\"Close\" (click)=\"modal.dismiss('Cross click')\">\r\n      <span aria-hidden=\"true\">&times;</span>\r\n    </button>\r\n  </div>\r\n  <div class=\"modal-body\">\r\n    <input #rut class=\"form-control form-control-sm\" type=\"\" name=\"\" [value]=\"user.rut\">\r\n    <br>\r\n    <input #password class=\"form-control form-control-sm\" type=\"password\" placeholder=\"Ingrese su contraseña\" name=\"\">\r\n    <br>\r\n    <button class=\"btn btn-success btn-block btn-sm\" (click)=\"btn_validar_usuario(rut,password,validar)\">\r\n      Validar\r\n    </button>\r\n    <img *ngIf=\"load\" height=\"30\" src=\"https://thumbs.gfycat.com/UnitedSmartBinturong-max-1mb.gif\">\r\n  </div>\r\n</ng-template>\r\n\r\n<ng-template #Mensual let-modal>\r\n\r\n  <div class=\"modal-header\" id=\"demoFont\">\r\n    <h6 class=\"modal-title\"><i class=\"fas fa-calendar-alt\"></i> <strong> Cuenta Bienestar / Inicio y Cierre\r\n        Mensual</strong></h6>\r\n    <button type=\"button\" class=\"close\" aria-label=\"Close\" (click)=\"modal.dismiss('Cross click')\">\r\n      <span aria-hidden=\"true\">&times;</span>\r\n    </button>\r\n  </div>\r\n  <!--Cuerpo del body inicio y cierre mensual-->\r\n  <div class=\"modal-body\">\r\n\r\n    <p>\r\n      <ngb-alert type=\"warning\" [dismissible]=\"false\">\r\n        <small><i class=\"fas fa-exclamation-circle fa-2x\"></i> <strong> Advertencia!</strong> El primer mes de cada año\r\n          se debe ingresar el monto incial de forma manual.</small>\r\n      </ngb-alert>\r\n    </p>\r\n\r\n    <div class=\"row\">\r\n      <div class=\"col-12 col-md-6 col-lg-6\"><br><label><strong>Año</strong></label>\r\n        <select [(ngModel)]=\"anio\" class=\"form-control form-control-sm\">\r\n          <option *ngFor=\"let anio of anios\" [value]=\"anio.id\">{{anio.descripcion}}</option>\r\n        </select>\r\n      </div>\r\n\r\n      <div class=\"col-12 col-md-6 col-lg-6\"><br><label><strong>Mes</strong></label>\r\n        <select [(ngModel)]=\"mes\" class=\"form-control form-control-sm\" #selectOptionMes>\r\n          <option *ngFor=\"let mes of meses\" [value]=\"mes.id\">{{mes.descripcion}}</option>\r\n        </select>\r\n      </div>\r\n    </div>\r\n      \r\n    <div class=\"row justify-content-between\">\r\n      <div class=\"col-12 col-md-4 col-lg-4\">\r\n        <br><label><strong>Calcular monto</strong></label><br>\r\n        <button (click)=\"calcular()\" type=\"submit\" name=\"botonCalcular\"\r\n          class=\"btn btn btn-outline-success btn-block btn-sm\" [disabled]=\"selectOptionMes.value == '1'\"><i\r\n            class=\"fas fa-calculator\"></i> Calcular</button>\r\n      </div>\r\n\r\n      <div class=\"col-12 col-md-4 col-lg-4\">\r\n        <br><label><strong>Monto Inicial</strong></label>\r\n        <input class=\"form-control form-control-sm\" type=\"number\" name=\"montoInicial\" #montoInicial=\"ngModel\"\r\n          [(ngModel)]=\"monto\" minlength=\"1\" required>\r\n      </div>\r\n\r\n      <div class=\"col-12 col-md-4 col-lg-4\">\r\n        <br><label><strong>Guardar Monto</strong></label><br>\r\n        <button class=\"btn btn btn-success btn-block btn-sm\" (click)=\"validar_usuario(validar)\">\r\n          <i class=\"fas fa-save\"></i> Guardar</button>\r\n      </div>\r\n    </div>\r\n    <br>\r\n    <div *ngIf=\"success_visible\" class=\"alert alert-primary\" role=\"alert\">\r\n      {{ txt }}\r\n    </div>\r\n\r\n    <div *ngIf=\"failed_visible\" class=\"alert alert-danger\" role=\"alert\">\r\n      {{ txt }}\r\n    </div>\r\n    <hr>\r\n    <ngb-alert type=\"warning\" [dismissible]=\"false\">\r\n      <small><i class=\"fas fa-exclamation-circle fa-2x\"></i> <strong> Informativo!</strong> En el ítem <b>\"Monto de\r\n          cierre\"</b> de la siguiente tabla cuando aparezca un <b>(*)</b>, significa que el monto aun no ha sido\r\n        calculado, cuando avance en cada mes es necesario ir calculando de manera responsable sus inicios y cierres\r\n        mensuales.</small>\r\n    </ngb-alert>\r\n    <div class=\"col-sm-6 col-md-3 col-lg-3\"><br><label><strong>Filtro por Año</strong></label>\r\n      <select [(ngModel)]=\"f_anio\" (change)=\"cambiar_anio()\" class=\"form-control form-control-sm\">\r\n        <option *ngFor=\"let anio of f_anios\" [value]=\"anio.id\">{{anio.descripcion}}</option>\r\n      </select>\r\n    </div>\r\n    <br>\r\n    <!--tabla del modal inicio y cierre mensual-->\r\n    <div class=\"table-responsive\">\r\n      <table class=\"table table-bordered table-sm\">\r\n        <thead text-sm class=\"text-center\">\r\n\r\n          <tr>\r\n            <th colspan=\"14\" class=\" text-center\" id=\"demoFont\">\r\n              <h6>Movimiento anual</h6>\r\n            </th>\r\n          </tr>\r\n\r\n          <tr>\r\n            <th scope=\"col\" colspan=\"3\">Año</th>\r\n            <th scope=\"col\" colspan=\"3\">Mes</th>\r\n            <th scope=\"col\" colspan=\"3\">Monto inicial(mes anterior)</th>\r\n            <th scope=\"col\" colspan=\"3\">Monto de cierre</th>\r\n          </tr>\r\n        </thead>\r\n        <tbody>\r\n          <tr class=\"text-center\" *ngFor=\"let t of tabla\">\r\n            <td scope=\"col\" colspan=\"3\">{{ t.anio }}</td>\r\n            <td scope=\"col\" colspan=\"3\">{{ t.mes }}</td>\r\n            <td scope=\"col\" colspan=\"3\">{{ t.inicio_mensual_m }}</td>\r\n            <td scope=\"col\" colspan=\"3\">{{ t.cierre_mensual_m }}</td>\r\n          </tr>\r\n        </tbody>\r\n      </table>\r\n    </div><br>\r\n  </div>\r\n\r\n\r\n  <!--boton para volver a cuenta sindical del inicio y cierre mensual-->\r\n  <div class=\"modal-footer\">\r\n    <button type=\"button\" class=\"btn btn-info\" (click)=\"modal.close('Close click')\">Volver a Cuenta\r\n      Sindical\r\n    </button>\r\n  </div>\r\n\r\n\r\n\r\n\r\n</ng-template>\r\n\r\n<!--Boton Para llamar al Modal inicio y cierre mensual-->\r\n<label><strong>Inicio y Cierre Mensual</strong></label><br>\r\n<button class=\"btn btn btn-success btn-block btn-sm\" (click)=\"openMensual(Mensual)\">Ingresar</button>\r\n\r\n<style>\r\n  .modal-content{\r\n    background: green;\r\n  }\r\n</style>"

